var $bm_rt;
var animationStartTime = 1;
var animationEndTime = 2;
var startValue = value;
var endValue = $bm_mul(value, 2);
if (numKeys > 0) {
    var nearestKeyIndex = nearestKey(time).index;
    if (key(nearestKeyIndex).time > time)
        nearestKeyIndex--;
    if (nearestKeyIndex === 0 || nearestKeyIndex === numKeys) {
        startValue = endValue = value;
    } else {
        animationStartTime = key(nearestKeyIndex).time;
        animationEndTime = key($bm_sum(nearestKeyIndex, 1)).time;
        startValue = key(nearestKeyIndex).value;
        endValue = key($bm_sum(nearestKeyIndex, 1)).value;
    }
}
$bm_rt = easeIn(time, animationStartTime, animationEndTime, startValue, endValue);

